import { useState } from "react";

export const CreateFlight = () => {

    const {flight, setFlightID} = useState();

    const handleSubmit = (event) => {
        event.preventDefault(); // prevents page refresh on submit
    }
    return (
        <>
            <form>
                <label htmlFor="flight">Flight ID Number</label>
                <input id="flight" placeholder="Please Enter Flight ID Number" />
                <label htmlFor="maxPass">Maximum Passenger Capacity</label>
                <input id="maxPass" placeholder="Please Maximum Passenger Capacity" />
                <label htmlFor="depCity">Departure City</label>
                <input id="depCity" placeholder="Enter Departure City" />
                <label htmlFor="depTime">Departure Time</label>
                <input id="depTime" placeholder="Enter Departure Time" />
                <label htmlFor="depDate">Departure Date</label>
                <input id="depDate" placeholder="Enter Departure Date" />
                <label htmlFor="arrCity">Arrival City</label>
                <input id="arrCity" placeholder="Enter Arrival City" />
                <label htmlFor="arrTime">Arrival Time</label>
                <input id="arrTime" placeholder="Enter Arrival Time" />
                <label htmlFor="arrDate">Arrival Date</label>
                <input id="arrDate" placeholder="Enter Arrival Date" />
                <button onClick={handleSubmit}>setFlightID</button>
            </form>
        
        </>

    );
}
